import React from "react";
import { data } from "../helper/data";

const CardContainer = () => {
  return (
    <div>
      <div>
        <input type="text" name="" id="" placeholder="Search Player..." />
      </div>
      <div className="card-container">
        {data.map((player) => (
          <div className="card">
            <img src={player.img} alt="player-img" />
            <h3>{player.name}</h3>
          
          </div>
        ))}
      </div>
    </div>
  );
};

export default CardContainer;
